import React from 'react';
import { Container, CssBaseline } from '@mui/material';
import Home from './Home';

function App() {
  return (
    <>
      <CssBaseline />
      <Container maxWidth="lg">
        <Home />
      </Container>
    </>
  );
}

export default App;
